function HeroVideo({ selectedVideo, selectedInfo }) {
  return (
    <div className="main-video">
      {/* <video */}
      <div>
        selectedVideo={selectedVideo}
        selectedInfo={selectedInfo}
        className="main-video__video-control" poster=
        {videoDetails[selectedVideo].image}
        type="video/mp4" src="#" alt={videoDetails[selectedInfo].title}
        controls
      </div>
      {/* /> */}
    </div>
  );
}

export default HeroVideo;
